import React from "react";
import { Box } from "@mui/material";
import { Paper } from "@mui/material";
import Grid from "@mui/material/Grid2"; // Import new Grid2 API
const Category = () => {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2} className="categoryContainer">
        <Grid item xs={12} sm={6} lg={6} md={6} className="firstGridContainer">
          Item 1
        </Grid>
        <Grid item xs={12} sm={6} lg={6} md={6} className="secondGridContainer">
          Item 2
        </Grid>
      </Grid>
    </Box>
  );
};

export default Category;
